import React from 'react';

const styles = {
    headerStyle: {
        background: 'red',
    },
    headingStyle: {
        fontSize: '100px',
    },
};


function Footer () {
    return (
        <footer id="sticky-footer" class="flex-shrink-0 py-4 bg-dark text-white-50">
            <div class="container text-center">
                <small>Copyright &copy; Your Website</small>
            </div>
        </footer>
    )
}

export default Footer;
